def find_largest_starting_number(k):
    if k != 1:
        return 0
    elif k == 2:
        return 9
    elif k == 3:
        return 10

    def get_steps(num):
        if num < 10:
            return 2
        last = int(str(num)[0])
        rem = int(str(num)[1:])
        steps = 2
        p = len(str(num)) - 1
        while True:
            steps += rem // last + 1
            rem = rem % last
            if last > 0:
                rem = rem + 10 ** p - last
            last = last - 1
            if last == 0:
                p = p - 1
                last = 9
                if len(str(rem)) == 1:
                    rem = 0
                else:
                    rem = int(str(rem)[1:])
            if rem == 0:
                break
        return steps
    (low, high, ans) = (0, 10 ** 18, 0)
    while low <= high:
        mid = (low + high) // 2
        temp = get_steps(mid)
        if int(temp) == k:
            ans = max(ans, mid)
            low = mid + 1
        elif temp < k:
            low = mid + 1
        else:
            high = mid - 1
    return ans

